import React from 'react';

const ServiceItem = ({ icon, title, description, delay }) => {
  return (
    <div className="col-lg-4 col-md-6 wow animate__slideInUp" data-wow-delay={delay}>
      <div className="service-item rounded h-100">
        <div className="d-flex justify-content-between">
          <div className="service-icon">
            <i className={`fa ${icon} fa-2x`}></i>
          </div>
          <a className="service-btn" href="">
            <i className="fa fa-link fa-2x"></i>
          </a>
        </div>
        <div className="p-5">
          <h5 className="mb-3">{title}</h5>
          <span>{description}</span>
          <a className="btn btn-primary rounded-pill py-2 px-5 mt-3" href="">Read More</a>
        </div>
      </div>
    </div>
  );
};

export default ServiceItem;
